import './App.css';

import Home from "./pages/Home";
import Meny from "./pages/Meny";

import {BrowserRouter as Router, Route, Switch} from "react-router-dom";

function App() {
  return (
    <div> 
      <Router>
      <Switch>
      <Route exact path="/" component={Home}/>
      <Route path="/Meny" component={Meny}/>
      </Switch>
      </Router>
    </div>
  );
}

export default App;
